import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Activities from "./components/Activities/Activities";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/activities">
            <Activities />
          </Route>
          <Route path="/stats">Stats</Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
